    /**
     * 超时。
     */
    public int minTotalDistance(int[][] grid) {
        int res = Integer.MAX_VALUE;
        for (int i = 0; i < grid.length; i++) {
            for (int j = 0; j < grid[0].length; j++) {
                res = Math.min(res, search(grid, i, j));
            }
        }
        return res;
    }


    private int search(int[][] grid, int row, int col) {
        Queue<int[]> queue = new LinkedList<>();
        queue.offer(new int[]{0, row, col});
        boolean[][] rec = new boolean[grid.length][grid[0].length];
        int res = 0;
        Set<String> set = new HashSet<>();
        while (!queue.isEmpty()) {
            int[] poll = queue.poll();

            int d = poll[0];
            int i = poll[1];
            int j = poll[2];
            if (i < 0 || j < 0 || i >= grid.length || j >= grid[0].length) {
                continue;
            }
            if (rec[i][j]) {
                continue;
            }
            if (grid[i][j] == 1) {
                res += poll[0];
            }
            rec[i][j] = true;
            queue.offer(new int[]{d + 1, i - 1, j});
            queue.offer(new int[]{d + 1, i + 1, j});
            queue.offer(new int[]{d + 1, i, j - 1});
            queue.offer(new int[]{d + 1, i, j + 1});
        }

        return res;
    }

    public int minTotalDistanceV2(int[][] grid) {
        List<Integer> rows = collectRows(grid);
        List<Integer> cols = collectCols(grid);
        int row = rows.get(rows.size() / 2);
        int col = cols.get(cols.size() / 2);
        return minDistance1D(rows, row) + minDistance1D(cols, col);
    }

    private int minDistance1D(List<Integer> points, int origin) {
        int distance = 0;
        for (int point : points) {
            distance += Math.abs(point - origin);
        }
        return distance;
    }

    private List<Integer> collectRows(int[][] grid) {
        List<Integer> rows = new ArrayList<>();
        for (int row = 0; row < grid.length; row++) {
            for (int col = 0; col < grid[0].length; col++) {
                if (grid[row][col] == 1) {
                    rows.add(row);
                }
            }
        }
        return rows;
    }

    private List<Integer> collectCols(int[][] grid) {
        List<Integer> cols = new ArrayList<>();
        for (int col = 0; col < grid[0].length; col++) {
            for (int row = 0; row < grid.length; row++) {
                if (grid[row][col] == 1) {
                    cols.add(col);
                }
            }
        }
        return cols;
    }
